import axios from "axios";
import { Component } from "react";

const url = "https://covid19.mathdro.id/api";

const fetchData = async () => {
  try {
    const response = await axios.get(url);
  } catch (error) {}
};

const componentDidMount = () => {
  this.fetchData();
};

export default fetchData;
